import React, { Component } from 'react';


class AgregarEquipo extends Component {

  constructor() {
    super();
  }

  render (){
    return (
      <div className="AgregarEquipo">
        <div className="container">
          <div className="row">
            <div className="col s1">
              <div className="card">
                <div className="card-content">
                  <h1>Nicolle</h1>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default AgregarEquipo;
